import "./style.css";

function App() {
  return (
    <>
      <header>
        <div class="logo">
          <img src="logo.png" width="68" height="68" alt="Logo" />
          <h1>Knowledge Forum</h1>
        </div>
        <button class="btn btn-large" id="show-form-btn">
          Share a fact
        </button>
      </header>
    </>
  );
}

export default App;
